import React from 'react';
import { Row, Container, Col } from 'react-bootstrap';

export const Header = () => {
    return (
        <>
            <Container >
                <Row className="justify-content-md-center">
                    <Col md={8}>
                        <Row className="justify-content-md-center">
                            <h1>DEVON COX</h1>
                            <h4>UI/UX Designer + Front-End Developer</h4>

                        </Row>
                    </Col>
                </Row>
            </Container>
        </>

    )
}
